n=A.C5("Xs and Os (Irish English), tic-tac-toe (American English) or noughts and crosses (Commonwealth English) is a paper-and-pencil game for two players who take turns marking the spaces in a three-by-three grid with X or O. The players who succeeds in placing three of their marks in a horizontal, vertical, or diagonal row is the winner",A.a(["Tap on any spot on the grid to play your character, either X or O",j,"You win a point when there is a 3 character pattern in any direction (diagonally, vertically or horizontally)"],h),n)
m=A.C5("Word Puzzle is a popular word game that challenges players to form words by connecting letters in a grid. It can be played solo or in a group, with the goal of finding as many words as possible within a limited time or move set. The game is both entertaining and educational, helping players enhance their vocabulary and problem-solving skills.",A.a(["Players are presented with a grid of scrambled letters","The objective is to connect adjacent letters (horizontally, vertically, or diagonally) to form valid words","Each word must contain at least two or more letters, depending on the game version","Players score points based on the length and complexity of the words formed","The game ends when time runs out or no more valid words can be formed"],h),A.a(["Words must be real and listed in the game\u2019s accepted words","Letters must be adjacent to each other to form a word","Each letter can only be used once per word"],h))
